import React, { Component } from "react";
import { Table, Tag } from 'antd';

const columns = [
    {
        title: 'Version No',
        dataIndex: 'name',
        key: 'name',
        render: text => <a>{text}</a>,
    },
    {
        title: 'Status',
        dataIndex: 'age',
        key: 'age',
    },
    {
        title: 'Progress',
        dataIndex: 'address',
        key: 'address',
    },
    {
        title: 'Start Date',
        dataIndex: 'address',
        key: 'address',
    },
    {
        title: 'Release Date',
        dataIndex: 'address',
        key: 'address',
    },
    {
        title: 'Description',
        dataIndex: 'address',
        key: 'address',
    },
    {
        title: 'Action',
        key: 'action',
        render: (text, record) => (
            <span>
                <a style={{ marginRight: 16 }}>Invite {record.name}</a>
                <a>Delete</a>
            </span>
        ),
    },
];

const data = [
    {
        key: '1',
        name: 'John Brown',
        age: 32,
        address: 'New York No. 1 Lake Park',
        tags: ['nice', 'developer'],
    },
    {
        key: '2',
        name: 'Jim Green',
        age: 42,
        address: 'London No. 1 Lake Park',
        tags: ['loser'],
    },
    {
        key: '3',
        name: 'Joe Black',
        age: 32,
        address: 'Sidney No. 1 Lake Park',
        tags: ['cool', 'teacher'],
    },
];


export default class ReleaseList extends Component {

    constructor(props) {
        super(props);
        this.state = {

        }
    }

    return() {
        render(
            <Table columns={columns} dataSource={data} />
        )
    }


}
